CREATE TABLE `ordinary_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `external_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `first_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `last_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `voted` tinyint(1) DEFAULT '0',
  `singer_id` int(11) DEFAULT NULL,
  `auth_type` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `avatar` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `last_login` datetime DEFAULT NULL,
  `last_logout` datetime DEFAULT NULL,
  `last_voted` datetime DEFAULT NULL,
  `vote_cancel` tinyint(4) DEFAULT '0',
  UNIQUE KEY `id` (`id`),
  KEY `user_singer_id_index` (`singer_id`),
  KEY `user_auth_type_index` (`auth_type`(250)),
  KEY `user_external_id_index` (`external_id`(250)),
  KEY `user_voted_index` (`voted`),
