  KEY `ordinary_user_last_logout_index` (`last_logout`),
  KEY `ordinary_user_last_voted_index` (`last_voted`),
  KEY `ordinary_user_vote_cancel_index` (`vote_cancel`)
) ENGINE=MyISAM AUTO_INCREMENT=205 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
